import React from "react";

const modal = (props) => {
  return (
    <section className="modal warning">
      <h3 className="modal-header">{props.modalH}</h3>
      <p className="modal-info">
        {props.modalP}
      </p>
      <button className="btn-understand btn">
        {props.modalBtn}
      </button>
    </section>
  );
};

export default modal;
